aipAPI.prototype.parseAdsTxt = function(adstxt) {
	try {
		const result = []
		const body = adstxt;
		const lines = body.split('\n')
		lines.forEach(x => {
			const line = x.replace(/#.*/gi, '')
			const cols = line.split(',')
			const adsystemDomain = (cols[0] || '').toLowerCase().trim()
			const sellerId = (cols[1] || '').toUpperCase().trim()
			const accountType = (cols[2] || '').toUpperCase().trim()
			//const tagId = (cols[3] || '').toLowerCase().trim()
			//const entryComment = (/#.*/.test(x) ? x.replace(/.*#(.*)/gi, '$1').trim() : '')
			if (!adsystemDomain) {
				return false
			}
			const entry = {
				adsystemDomain,
				sellerId,
				accountType
				//tagId,
				//entryComment
			}
			if (adsystemDomain == "adinplay.com") {
				result.push(entry)
			}
		})
		return result;
	} catch (e) {}
}

aipAPI.prototype.stats = function() {
	function getTLD() {
		var host = (window && window.location && window.location.hostname) || '';
		var parts = host.split(".");
		return ((parts.length > 1) ? parts.slice(-2).join('.') : '');
	}

	function setCookie(name, value, maxAgeSeconds, domain, path) {
		if (typeof(path) === 'undefined') { path = "/"; }
		if (typeof(domain) === 'undefined') {
			domain = ";domain=" + getTLD();
		} else {
			domain = '';
		}
		var now = new Date();
		now.setSeconds(now.getSeconds() + maxAgeSeconds);        
		document.cookie = name + " = " + value + domain + ";path=" + path + ";max-age=" + maxAgeSeconds + ";Expires=" + now.toUTCString(); 
	}

	try {
		var cookie = ("; " + document.cookie);
		var cookiePart = cookie.split(("; " + "StatsSend" + "="));
		if (cookiePart.length !== 2) {
			setCookie("StatsSend", "true", "86400");
			//setTimeout(function() {
				aipAPItag.sendStats();
			//}, 5000);
		}
	} catch(e){}
}

aipAPI.prototype.sendStats = function() {
	//send js path for active adslibs
	try {
		//if (Math.random() < 0.01) {
		if (!window.location.href.includes("adinplay.com")) {
			var data = JSON.stringify({"jspath":"api.adinplay.com/libs/aiptag/pub/SSK/footballbros.io/tag.min.js"});
			var xhr = new XMLHttpRequest();
			xhr.timeout = 800;
			xhr.open("POST", "https://stats.adinplay.com/collect");
			xhr.setRequestHeader("Content-Type", "application/json");
			xhr.send(data);
		}
	} catch(e){}

	if(aiptag.settings.iSendStats === false) {return false;}

	try {
		var rawFile = new XMLHttpRequest();
		rawFile.open("GET", "/ads.txt", true);
		rawFile.timeout = 500;
		rawFile.onreadystatechange = function() {
			if (rawFile.readyState === 4) {
				var allText = rawFile.responseText;
				var adsTxtEntry = aipAPItag.parseAdsTxt(allText);
				var seller_id_ads_txt = "";

				if(adsTxtEntry[0] !== undefined) {
					seller_id_ads_txt = adsTxtEntry[0].sellerId;
				}

				var urlParts = new URL(window.location.href).hostname.split('.');
				var domain = urlParts.slice(0).slice(-(urlParts.length === 4 ? 3 : 2)).join('.');
				var aip_id = "SSK/footballbros.io";
				var seller_id_js = "SSK";
				var mcm_js = "21743024831";
				var data = JSON.stringify({"domain":domain,"aip_id":aip_id,"seller_id_ads_txt":seller_id_ads_txt,"seller_id_js":seller_id_js,"mcm_js":mcm_js});

				if(domain.match(/[a-z]/i)) {
					if (Math.random() < 0.01) {
						var xhr = new XMLHttpRequest();
						xhr.timeout = 150;
						xhr.open("POST", "https://stats.adinplay.com/collect");
						xhr.setRequestHeader("Content-Type", "application/json");
						xhr.send(data);
					}
				}
			}
		}
		rawFile.send();
	} catch(e){}
}

